window.bookSummaryJSON = "<p><b>Not all alphas are good men.</b></p> <p>Charlie learned that lesson the hard way. After losing her daughter's father in a senseless act of violence, she hasn't figured out how to move on. She's trapped in a cycle of guilt and misery. It makes her the perfect target for a man who only wants to control her and exploit her impulses.</p> <p>A chance introduction at a neighbor's barbecue changes everything.</p> <p>The three owners of The Omega Exchange's Colorado location are as enamored by Charlie's daughter as they are the sad-eyed omega. Determined to help her escape, they offer her the opportunity to be whisked away to safety. Charlie doesn't hesitate, but danger follows.</p> <p>It appears the past isn't letting go without a fight.</p>"; 
